import React from 'react';
import { Container, Navbar, Nav, Row, Col } from 'react-bootstrap';
import { Facebook, Twitter, Instagram, Linkedin } from 'react-bootstrap-icons';

const Header = () => {
  return (
    <Container fluid className="px-4">
      {/* Logo Section */}
      <Row className="py-3 border-bottom">
        <Col className="text-center">
          <h1 className="fw-bold mb-0">PropertyProinsider</h1>
        </Col>
      </Row>

      {/* Navigation Bar with Social Icons */}
      <Navbar expand="lg" className="py-2">
        <Container fluid>
          <Navbar.Toggle aria-controls="main-nav" />
          <Navbar.Collapse id="main-nav">
            <Nav className="mx-auto gap-4">
              <Nav.Link href="#" className="text-uppercase px-0">HOME</Nav.Link>
              <Nav.Link href="#" className="text-uppercase px-0">REAL ESTATE NEWS</Nav.Link>
              <Nav.Link href="#" className="text-uppercase px-0">HOUSE STORIES</Nav.Link>
              <Nav.Link href="#" className="text-uppercase px-0">REAL ESTATE ADVICE</Nav.Link>
              <Nav.Link href="#" className="text-uppercase px-0">HOME DECORATION</Nav.Link>
              <Nav.Link href="#" className="text-uppercase px-0">PROPERTYPRO</Nav.Link>
            </Nav>
            
            <Nav className="ms-auto gap-3">
              <Nav.Link href="#"><Facebook size={18} /></Nav.Link>
              <Nav.Link href="#"><Twitter size={18} /></Nav.Link>
              <Nav.Link href="#"><Instagram size={18} /></Nav.Link>
              <Nav.Link href="#"><Linkedin size={18} /></Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </Container>
  );
};

export default Header;
